import './App.css';
import Button from 'react-bootstrap/Button';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';

function App() {
  return (
    <div className="App">
      <Form>
        <Form.Control type="email" placeholder="Enter a word" />
      </Form>
    </div>
  );
}

export default App;
